function getULBStateList(jsonULBListUrl,stateId){
	 $.ajax({
        type: "POST",
        url: jsonULBListUrl,
        contentType : "application/json",
        dataType : 'json',
        async: false,
        headers: {
            //"Authorization": "Basic " + btoa(invoiceapiuser+":"+invoiceapipassword),
            "Authorization": "Basic " + btoa("ashok:pass") 
            //"USER":btoa(getUserId(storeInvUser)),
           // "BUSID":btoa( getBussId(storeselectInvBusinessId))
        },
        success: function (data){
          console.log("VAL: "+data.totalRows);
          var row = 1;
          dataSet = [];
          if(parseInt(data.totalRows) > 0){
       	   var newArray = [];
       	   var totCol = 0;
       	   $.each(data.resultData, function (i, result) {
                  //console.log(" >>> "+result.propertyId);
       		   $("#"+stateId).append($("<option></option>").val(result.id).html(result.desc));
              });
       	  
          }else{
                new PNotify({
                    title: 'Data Not Found.',
                    styling: 'bootstrap3',
                    type: 'error'
                });
          }
        },
        statusCode: {
		    403: function() {
		    	 new PNotify({
                    title: 'Session Expire. Please Re-Login...',
                    styling: 'bootstrap3',
                    type: 'error'
                });
		    	 setTimeout(function(){
		                window.location.href="/"; 
		            }, 2000);
		    }
		},
        error : function(e) {
                  console.log("ERROR: ", e.responseText);
                  console.log("ERROR: ", e);
                //	display(e);
            new PNotify({
                    title: 'Request Not Process... ',
                    styling: 'bootstrap3',
                    type: 'error'
                });
            }
        });
	
}

